unsigned char img_buf[72 * 96 / 8];

int main(void)
{
	unsigned int i = 0;
	unsigned char line;
	arch.setup();
	gpio.setup();
	kout.setup();
	spi.setup();
	sharp96.setup();
	sharp96.powerOn();
	sharp96.clear();

	timer.setup_hz_low(7);

	while (1) {
		for (i = 0; i < (sizeof(images) / sizeof(images[0])); i++) {

			timer_done = 0;
			timer.start(1);

			inflate(images[i], 72*96/8, img_buf, sizeof(img_buf));

			while (!timer_done) {
				arch.idle();
			}

			timer.stop();

			for (line = 0; line < 72; line++) {
				sharp96.writeLine(line, img_buf + (12 * line));
			}

			if ((i%10)==0) {
				sharp96.toggleVCOM();
			}
		}
	}

	return 0;
}

